const SvgComponent = (props) => {
    switch (props.name) {
        case 'Destination':
            return <DestinationIcon />;
        case 'Activities':
            return <ActivitiesIcon />;
        case 'Hotel':
            return <HotelIcon />;
        case 'Restaurant':
            return <RestaurantIcon />;
        case 'QRCode':
            return <QRCodeIcon />;
        case 'Search':
            return <SearchIcon />;
        case 'StarSmall0':
            return <StarIcon color="#FFC107" size="16" />;
        case 'StarSmall1':
            return <StarIcon color="#fff" size="16" />;
        case 'StarBig0':
            return <StarIcon color="#FFC107" size="25" />;
        case 'StarBig1':
            return <StarIcon color="#fff" size="25" />;
        case 'BackArrow':
            return <BackArrowIcon />;
        case 'ThreeDots':
            return <ThreeDotsIcon />;
        case 'Clock':
            return <ClockIcon size="40" />;
        case 'Location':
            return <LocationIcon size="40" />;
        case 'UserVerification':
            return <UserVerificationIcon size="40" />;
        case 'Reputation':
            return <ReputationIcon size="40" />;
        case 'Ticket':
            return <TicketIcon size="40" color="black" />;
        case 'Blockchain':
            return <BlockchainIcon size="40" />;
        case 'Heart0':
            return <Heart0Icon size="25" />;
        case 'Heart1':
            return <Heart1Icon size="25" />;
        case 'HeartSmall0':
            return <Heart0Icon size="17" />;
        case 'HeartSmall1':
            return <Heart1Icon size="17" />;
        case 'Send':
            return <SendIcon size="25" />;
        case 'PreviousBlue':
            return <PreviousIcon
                size="15"
                color="#39a7ff"
            />;
        case 'PreviousWhite':
            return <PreviousIcon
                size="15"
                color="#fff"
            />;
        case 'Settings':
            return <SettingsIcon size="30" color="#828282" />;
        case 'Help':
            return <HelpIcon size="30" color="#828282" />;
        case 'History':
            return <HistoryIcon size="30" color="#828282" />;
        case 'Voucher':
            return <TicketIcon size="30" color="#828282" />;
        case 'MetaMask':
            return <MetaMaskIcon size="25" />;
        case 'TotalReward':
            return <TotalRewardIcon size="40" />;
        case 'ReplyComment':
            return <ReplyComment size="19" />;
        default:
            return <DestinationIcon />;
    }
}

export default SvgComponent;